import React, { useState } from 'react';
import './RegisterLogin.css';


const RegisterLogin = () => {

const [newEmployee , setEmployee] = useState(
    {firstName : "",
    lastName : "",
    email : "",
    password : ""}
    );

    const onValueChange = (value) => {
        const employee =  {firstName : value,
        lastName : "",
        email : "",
        password : ""};
        setEmployee(employee);
    }

const handleSubmit = (e) => {
e.preventDefault();
console.log(newEmployee.firstName);
}


  return (
    <div className="container">
    <h1 align="center">Register</h1>
    <form className="form" method="post" onSubmit={handleSubmit}>
        <div className="input-box">
            <label for="exampleInputEmail1">First Name</label>
            <input type="text" class="form-control" value={newEmployee} onChange={(e) => onValueChange(e.target.value)}
            placeholder="Enter First Name"></input>
        </div>
        <div className="input-box">
            <label >Last Name</label>
            <input type="text" class="form-control" value={newEmployee.lastName} onChange={(e) => onValueChange(e.target.value)}
             placeholder="Enter Last Name"></input>
        </div>
        <div className="input-box">
            <label >Email Address</label>
            <input type="email" class="form-control" value={newEmployee.email} onChange={(e) => onValueChange(e.target.value)}
             placeholder="Enter Email Address"></input>
        </div>
        <div className="input-box">
            <label >Password</label>
            <input type="password" class="form-control" value={newEmployee.password} onChange={(e) => onValueChange(e.target.value)}
             placeholder="Password"></input>
        </div>

        <button type="submit">Submit</button>
        <button>Login</button>
    </form>
</div>
  )
}

export default RegisterLogin
